import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';


class HomePage extends Component  {
  render (){
    return (
      <div style={{width:'100%', margin: 'auto'}}>
        <Grid className="home-grid">
          <Cell col={12}>
            <img
              src= "https://freepngimg.com/thumb/wonder_woman/20973-1-wonder-woman-picture.png"
              alt='avatar'
              className='avatar-img'
              />
              <div className="banner-text">
                <h1>Full Stack Web Developer</h1>

                <hr/>
                <p>Ruby | Rails | JavaScript | React | HTML/CSS | SQL</p>

                <div className="social-links">
                  <a href="http://google.com" target="_blink">
                    <i className="fa-fa-linkedin-square" rel="noopener noreferrer" aria-hidden="true"/>
                  </a>
                </div>
              </div>
          </Cell>
        </Grid>
      </div>
    )
  }
}

export default HomePage;
